import React from 'react'
import { Link, NavLink } from 'react-router-dom'
import SearchBar from './SearchBar'
import { useSelector } from 'react-redux'
import './header.css'
import Categories from '../categories/Categories'

const Header = () => {
  const products = useSelector((state) => state.cart)
  console.log(products)
  if(!products) return 'Loading...'
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-white py-3 d-flex ">
  <a className="navbar-brand" href="#">Navbar</a>
  <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
    <span className="navbar-toggler-icon"></span>
  </button>

  <div className="collapse navbar-collapse d-flex" id="navbarSupportedContent">
    <ul className="navbar-nav mr-auto">
      <li className="nav-item active">
        <a className="nav-link" href="#">Home <span className="sr-only">(current)</span></a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>
      <li className="nav-item dropdown">
        <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
          Dropdown
        </a>
        <div className="dropdown-menu" aria-labelledby="navbarDropdown">
          <a className="dropdown-item" href="#">Action</a>
          <a className="dropdown-item" href="#">Another action</a>
          <div className="dropdown-divider"></div>
          <a className="dropdown-item" href="#">Something else here</a>
        </div>
      </li>
      <li className="nav-item">
        <a className="nav-link disabled" href="#">Disabled</a>
      </li>
    </ul>
   
  </div>
</nav>


// <> 
    // <div classNameName='header-header'>
    //      <div classNameName='header-logo'><Link to='/' classNameName='fw-bold fs-3 navbar-brand'> SHOPPING </Link> </div>
    //      <div classNameName='header-search'>
    //       <SearchBar/>
    //      </div>
    //      <div classNameName='header-menu'>
          
    //       <NavLink to='/cart'> <button classNameName='fa fa-cart-plus btn btn-outline  text-dark p-2 mx-2 rounded border-2 '> <span classNameName='mx-2'> {products.length > 0 ? products.length : null} </span> </button></NavLink>
    //      </div>

    // </div>
    // <Categories/>
    // </>
  )
}

export default Header
